import ContentComponent from "./component/ContentComponent/ContentComponent";
import "./styles.css";
import ClockComponent from "./component/ClockComponent/ClockComponent";

export default function App() {
  return (
    <div className="App">
      <NavComponent title="Timeline" />
      <ClockComponent />
      <ContentComponent />
    </div>
  );
}
